import React, { Component } from 'react';
import "./TaskButtons.css";
import {motion} from 'framer-motion';


function TaskButtons(){
  
    return (
    <div> 
     
      <motion.div initial={{opacity:0, transition: { duration:0.2, ease: "easeInOut" }}} animate={{opacity:1, transition: { duration:0.2, ease: "easeInOut" }}} exit={{opacity:0, transition: { duration:0.2, ease: "easeInOut" }}} className={`flex my-body`}>
        <div className="btn btn-secondary col-lg-3 col-md-2 fw-light text-decoration m-1">Button 1</div>
        <div className="btn btn-secondary col-lg-2 col-md-2 fw-light text-decoration ms-5">Button 2</div>
        <div className="btn btn-secondary col-lg-2 col-md-2 fw-light text-decoration m-1">Button 3</div>
      </motion.div>
      


    </div>

    );
    
  }
export default TaskButtons;
